"original": |2-
     JWS Protected Header
        JSON object that contains the Header Parameters that are integrity
        protected by the JWS Signature digital signature or MAC operation.
        For the JWS Compact Serialization, this comprises the entire JOSE
        Header.  For the JWS JSON Serialization, this is one component of
        the JOSE Header.
"fixed": |-
  JWS Protected Header  -  JSON object that contains the Header Parameters that are integrity protected by the JWS Signature digital signature or MAC operation. For the JWS Compact Serialization, this comprises the entire JOSE Header.  For the JWS JSON Serialization, this is one component of the JOSE Header.
"ko": |-
  JWS 보호 헤더 - JWS 서명 디지털 서명 또는 MAC 작업으로 무결성이 보호되는 헤더 매개변수를 포함하는 JSON 객체입니다. JWS Compact Serialization의 경우 전체 JOSE 헤더를 포함합니다. JWS JSON Serialization의 경우 JOSE 헤더의 한 구성 요소입니다.
